export async function getServerSideProps(context) {
  if (!context.query.rpt) {
    return {
      props: { RPT: null }
    };
  } else if (context.query.rpt.length > 10) {
    const validToken = new Promise(async (resolve, reject) => {
      await dbConnect();
      const RPT = context.query.rpt;
      const user = await User.findOne({
        'passwordReset.RPT': RPT
      });
      if (user) {
        const expiryDate = user.passwordReset.expiryDate;
        resolve(new Date(Date.now() + 60 * 1000) < expiryDate);
      } else {
        resolve(false);
      }
    });
    if (!(await validToken)) {
      return {
        props: { RPT: null }
      };
    } else {
      return {
        props: { RPT: context.query.rpt }
      };
    }
  } else {
    return {
      props: { RPT: null }
    };
  }
}
